import React, { Component, Fragment } from 'react';
import './style.css';


class Main extends Component {
    render() {
        return (
            <Fragment>
                <div className="starBg">
                    <div className="star"></div>
                    <div className="linerColor"></div>
                </div>
            </Fragment>
        )
    }
}

export default Main;
